  }

  editUser(user: any) {
    // Implement edit logic
  }

  deleteUser(user: any) {
    // Implement delete logic
  }
  openPopup() {
    this.dialog.open(AddUserComponent, {
      width: "100%", // adjust width as needed

      // Add more configuration options as needed
    });
  }

  navigateToAddUser() {
    this.router.navigate(["/admin/addUser"]);
  }
}
